INSERT INTO `artikel` (`artikel_id`, `artikel_title`, `artikel_content`, `artikel_date`, `gambar_id`, `katA_id`, `admin_id`, `artikel_status`) VALUES
(2, 'Wabah tomat penyakitan!', '<p>Hati-hati kepada kalian yang ingin membeli tomat. Selalu pastikan tomat yang kalian beli tidak diwabahi serangga. Tomat yang sehat bisa kamu dapatkan di Pasar segari. Beli sekarang!</p>', '2023-05-12', 37, 2, 1, 'aktif'),
(7, 'Cabai naik harga!', '<p>Cabai mulai akan naik harga termulai besok dengan kenaikan sebesar 6%. Segera borong cabai di pasar segari!</p>', '2023-12-05', 36, 2, 1, 'aktif'),
(9, 'Buah-buahan: Kunci untuk Kesehatan Optimal dan Gaya Hidup Seimbang', '<p>Manfaat buah untuk kesehatan tubuh sangat beragam. Selain untuk memelihara kesehatan organ, kandungan nutrisi pada buah juga bermanfaat untuk melindungi tubuh dari penyakit bahkan dapat membantu proses penyembuhan penyakit. Umumnya, semua buah mengandung nutrisi yang penting untuk tubuh. Nutrisi-nutrisi ini membuat manfaat buah untuk kesehatan tidak diragukan lagi dan sangat sayang untuk dilewatkan. Tidak heran jika para ahli kesehatan menyarankan untuk mengonsumsi buah setiap hari.&nbsp;Mengonsumsi buah-buahan setiap hari merupakan pola makan yang baik dan dapat menunjang gaya hidup sehat.</p><p>Beberapa manfaat buah bagi kesehatan tubuh antara lain adalah:</p><ul><li>Mencegah obesitas&nbsp;dan menjaga berat badan yang ideal</li><li>Menurunkan kadar kolesterol dan tekanan darah</li><li>Menurunkan risiko penyakit, seperti diabetes tipe 2, stroke, penyakit jantung, kanker, dan hipertensi</li><li>Mencegah dan mengatasi masalah pencernaan, seperti sembelit</li></ul>', '2023-01-05', 39, 2, 2, 'aktif'),
(10, 'Sayuran Sedang Diskon: Kesempatan Emas untuk Mengadopsi Pola Makan Sehat dengan Anggaran Terjangkau', '<p>Pencinta sayuran wajib merapat nih!</p><p>Ada promo aneka sayuran yang HEMATNYA gak ketulungan.</p><p>Dengan beli 8rb aja udah bisa dapetin sayuran banyak banget loh..<br />Kalian juga bisa dapatkan GRATIS 1pcs Mama Lime Mineral Salt dengan syarat tertentu ya..</p>', '2023-06-05', 40, 1, 2, 'aktif'),
(11, '5 Jenis Buah Semangka dan Cara Memilih yang Manis', '<p>Berikut trik memilih buah semangka yang banyak airnya dan manis daging buahnya. Bisa dipraktikkan pada&nbsp;buah semangka kecil dan juga besar</p><p><strong>1. Semangka matang ditandai dengan tangkai yang kering</strong></p><p>Kalau tangkai di bagian atasnya sudah bisa dicabut, itu berarti buah semangka sudah matang. Hindari memilih tangkai yang warnanya masih terlalu hijau dan sulit dipetik, sebab ini merupakan tanda kalau semangka belum begitu matang dan kurang manis.</p><p>&nbsp;</p><p><strong>2. Ketuk permukaan semangka&nbsp;</strong></p><p>Dengan mengetuk semangka, kamu akan tahu kepadatan daging buahnya. Semangka yang matang sempurna akan mengeluarkan suara yang berat dan penuh saat diketuk. Sedang semangka yang bunyinya nyaring justru memiliki banyak rongga dan daging buah yang kurang padat. Biasanya bunyi nyaring akan ditemukan pada semangka yang belum masak.</p><p>&nbsp;</p><p><strong>3. Periksa&nbsp;bercak kekuningan di kulit semangka</strong></p><p>Bercak kekuningan yang biasanya ada di bagian bawah buah bisa dijadikan indikator kematangan. Semakin lebar bercak kuningnya, makin lama pula semangka ditanam. Kalau bercak kuningnya lebih kecil dan warnanya pun pucat, berarti semangka dipanen lebih awal sebelum benar-benar matang di pohon. Jadi, pilihlah semangka dengan bercak kuning yang lebih lebar dan warnanya lebih pekat atau gelap.</p><p>&nbsp;</p><p><strong>4. Perhatikan jaring berwarna cokelat di kulit buah</strong></p><p>Tekstur kecokelatan di kulit semangka menandakan bahwa lebah menyentuh bagian penyerbukan bunga berkali-kali. Semakin banyak jaring maka makin manis pula rasa daging buahnya.</p><p>&nbsp;</p><p><strong>5. Pilih semangka dengan kulit warna hijau tua dan kusam</strong></p><p>Semangka dengan warna kulit hijau muda biasanya dipanen lebih awal sehingga rasanya pun tak semanis semangka dengan kulit hijau tua. Selain warna, pastikan juga kulit semangka nggak ada bekas goresan agar rasa manis daging buahnya tetap alami.</p>', '2023-01-09', 42, 2, 1, 'aktif'),
(12, 'Manfaat dan Kandungan Kulit Pisang', '<p>Kandungan Kulit Pisang</p><p>Sebelum membedah manfaat kulit pisang, tak ada salahnya memahami senyawa apa saja yang terdapat di dalam kulit yang sering dianggap limbah tersebut. Secara umum, kulit pisang banyak mengandung karbohidrat, air, vitamin C, kalium, lutein, anti-oksidan, kalsium, vitamin B, lemak, protein, beragam vitamin B kompleks di antaranya vitamin B6, minyak nabati, serat, serotonin dan banyak lagi lainnya. Semua komponen senyawa ini memiliki beragam khasiat yang baik bagi tubuh. Tak hanya itu, kupit pisang juga ternyata bisa menjadi sumber energi alternatif! Wow! Mengurai Manfaat Kulit Pisang</p><p>Mencermati kandungan zat aktifnya yang cukup kompleks, adalah sangat wajar jika kemudian kulit pisang juga memiliki beragam manfaat. Berikut beberapa manfaat kulit pisang yang dikutip dari berbagai sumber: Sebagai penambah mood. Tahukah Anda bahwa kulit pisang kaya akan zat serotonin. Zat ini bertanggungjawab atas rasa bahagia dalam tubuh manusia. Dan dengan rutin mengkonsumsi kulit pisang, akan membantu Anda lebih rileks dan bahagian tentunya. Di luar negeri, smooties pisang selalu bercampur bersama kulit. Sementara di Indonesia, smoothies pisang hanya berupa daging pisang yang dihaluskan. Sebagai pereda nyeri. Kulit pisang mengandung sejumlah minyak nabati juga sneyawa tertentu yang sangat baik meredam rasa nyeri. Caranya cukup mudah, tenpekan kulit pisang yang sudah dibersihkan dan juga masih dalam keadaan segar pada bagian tubuh Anda yang mengalami rasa nyeri karena terbakar atau tergores benda tajam. Mengatasi rasa gatal. Jika Anda sering merasakan gatal akibat gigitan serangga dan juga semut, gunakan kulit pisang. Cukup tempelkan di permukaan kulit yang gatal</p>', '2022-12-12', 43, 2, 1, 'aktif'),
(13, 'Pentingnya Makan Sayur dan Buah', '<p>1. Meningkatkan performa otak<br />Sebagian besar buah yang sudah maupun belum Anda kenal kaya akan gizi dan nutrisi yang sangat dibutuhkan tubuh. Dari sekian benefit yang akan Anda dapatkan, meningkatkan daya ingat sekaligus memproteksi sel-sel otak adalah salah dua poin yang diberikan sayur dan buah.<br />Antioksidan berperan dalam memerangi radikal bebas, karena mampu memperlambat hingga mencegah oksifasi molekul lain. Bahkan ada pula buah yang dapat melindungi Anda dari penyakit Alzheimer. Beberapa buah yang patut Anda konsumsi mencakup jeruk, apel, jambu biji, alpukat, pepaya, dan mangga.</p><p>2. Mengurangi risiko penyakit kanker<br />Kanker termasuk penyakit kronis yang saat ini masih belum ditemukan obatnya. Walau sukar untuk disembuhkan, gangguan akibat pertumbuhan abnormal sel-sel jaringan tubuh ini dapat Anda cegah sedini mungkin dengan mengonsumsi beberapa jenis buah berwarna merah dan ungu.<br />Manfaat buah dan sayur dari stroberi dan tomat di antaranya adalah menyuplai senyawa seperti lycopene dan anthocyanins yang mampu mencegah perkembangan kanker berkat kandungan anti-kanker secara alami. Konsumsi secara teratur supaya tubuh Anda sigap dalam mengatasi pertumbuhan sel jaringan abnormal.</p><p>3. Sumber utama antioksidan<br />Seperti yang telah disebutkan, sejumlah buah dan sayur kaya akan antioksidan&mdash;molekul yang mampu memperlambat hingga mencegah oksidasi molekul lain. Oksidasi sangat berbahaya karena memicu munculnya radikal bebas yang berpotensi merusak sel. Karena tubuh manusia tidak dapat memproduksi vitamin sendiri, maka<br />Anda disarankan untuk mengonsumsi sayur dan buah secara teratur supaya bisa memperoleh takaran antioksidan yang mencukupi. Buah-buah yang kaya akan vitamin A, vitamin C, dan vitamin E sangat direkomendasikan untuk menjaga kesehatan Anda.</p>', '2023-08-01', 44, 2, 1, 'aktif'),
(15, 'Fakta Menarik tentang Bayam, Salah Satu Sayuran Paling Sehat di Dunia', '<p>1. Mengandung Zat Besi<br />Bayam dikenal sebagai sumber makanan yang kaya akan nutrisi dan salah satu nutrisi yang terdapat dalam bayam adalah zat besi.Zat besi merupakan mineral yang sangat penting bagi tubuh manusia karena berperan dalam pembentukan hemoglobin.<br />Meski begitu, bayam juga merupakan jenis sayuran yang mengandung kadar asam oksalat yang cukup tinggi, terutama pada daunnya.</p><p>2. Kaya Vitamin dan Mineral<br />Selain zat besi, bayam juga merupakan sayuran yang kaya akan vitamin dan mineral.Bayam mengandung vitamin A, vitamin C, vitamin K, folat, magnesium, dan kalium. Karena itu, mengonsumsi bayam akan berdampak baik pada kesehatan tulang.<br />Selain itu, ada juga kandungan lutein dan zeaxanthin yang membantu menjaga kesehatan mata.</p><p>3. Mudah Terkontaminasi Pestisida<br />Meski memiliki banyak manfaat, teman-teman tetap harus waspada saat mengolah bayam.Bayam adalah jenis sayur yang sering terkontaminasi oleh pestisida.Karena itu, penting untuk selalu mencuci bayam dengan benar sebelum dimasak.</p>', '2023-10-04', 46, 2, 1, 'aktif'),
(16, 'Manfaat Luar Biasa Brokoli: Sayuran Super yang Menyehatkan', '<p>Brokoli adalah sayuran yang kaya nutrisi dan memiliki manfaat kesehatan yang luar biasa. Sayuran ini mengandung berbagai vitamin, mineral, serat, dan senyawa bioaktif yang membantu menjaga kesehatan tubuh. Artikel ini akan menggali lebih dalam tentang manfaat brokoli bagi kesehatan, termasuk dukungan terhadap sistem kekebalan tubuh, perlindungan terhadap penyakit kronis, kesehatan jantung, pencernaan yang sehat, dan lainnya.</p><ol><li><p>Kaya Nutrisi: Brokoli mengandung sejumlah nutrisi penting, termasuk vitamin C, vitamin K, vitamin A, asam folat, dan serat. Nutrisi ini berperan dalam menjaga kesehatan kulit, kesehatan mata, sistem kekebalan tubuh yang kuat, dan fungsi otak yang optimal.</p></li><li><p>Antioksidan dan Perlindungan terhadap Penyakit Kronis: Brokoli mengandung senyawa fitokimia, seperti sulforaphane dan indole-3-carbinol, yang memiliki sifat antioksidan dan anti-inflamasi. Senyawa ini dapat melindungi tubuh dari kerusakan oksidatif, peradangan, dan risiko penyakit kronis, termasuk kanker, diabetes, dan penyakit jantung.</p></li><li><p>Kesehatan Jantung: Brokoli dapat mendukung kesehatan jantung karena kandungan seratnya yang tinggi dan senyawa seperti glucoraphanin. Serat membantu mengurangi kolesterol jahat dalam darah, sedangkan senyawa glucoraphanin dapat membantu melindungi pembuluh darah</p></li></ol>', '2022-12-12', 47, 2, 1, 'aktif');

